import React, { useState, useEffect } from 'react';
import {  Container, Paper, Grid, Typography, Avatar, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import { LiveTv, PlaylistPlay, ViewQuilt, MoreHoriz, Settings, ExitToApp } from '@mui/icons-material';
import axios from 'axios';

const App = () => {
  const [userData, setUserData] = useState({ username: 'John Doe', avatar: '' });

  useEffect(() => {
    axios
      .get('https://jsonplaceholder.typicode.com/users/1')
      .then((response) => {
        setUserData({ ...response.data, showDetails: false });
      })
      .catch((error) => {
        console.error('Error fetching user data:', error);
      });
  }, []);

  return (
    <div style={{ background: '#151515', minHeight: '100vh', color: 'white' }}>

      <Container>
        <Grid container spacing={0}>
          <Grid item xs={1}>
            {/* Sidebar 1 - Logo */}
            <Paper style={{ height: '100vh', background: '#151515' }}>
              {/* Your logo */}
              <img src="logo.png" alt="Logo" style={{ width: '100px' }} />
            </Paper>
          </Grid>
          <Grid item xs={2.5}>
            {/* Sidebar 2 - User Info and Navigation */}
            <Paper style={{ height: '100vh', background: '#0D0D0F', padding: '16px',color:'white' }}>
            <div  style={{ display: 'flex', alignItems: 'center', }} >
            <div style={{ marginRight: '50px' }}> {userData.name} </div>
            <Avatar sx={{ cursor: 'pointer' ,marginRight:"20px" }}>{userData.name ? userData.name[0] : 'U'}</Avatar>
            </div>
              <List>
                <ListItem button>
                  <ListItemIcon><LiveTv /></ListItemIcon>
                  <ListItemText primary="Live" />
                </ListItem>
                <ListItem button>
                  <ListItemIcon><PlaylistPlay /></ListItemIcon>
                  <ListItemText primary="Sequence" />
                </ListItem>
                <ListItem button>
                  <ListItemIcon><ViewQuilt /></ListItemIcon>
                  <ListItemText primary="Layout" />
                </ListItem>
                <ListItem button>
                  <ListItemIcon><MoreHoriz /></ListItemIcon>
                  <ListItemText primary="More" />
                </ListItem>
                <ListItem button>
                  <ListItemIcon><Settings /></ListItemIcon>
                  <ListItemText primary="Settings" />
                </ListItem>
                <ListItem button>
                  <ListItemIcon><ExitToApp /></ListItemIcon>
                  <ListItemText primary="Logout" />
                </ListItem>
              </List>
            </Paper>
          </Grid>
          <Grid item xs={8}>
            {/* Main Content */}
            <Paper style={{ background: '#151515', padding: '16px' }}>
              {/* Your content goes here */}
            </Paper>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default App;
